  function showWomanCard(){
	var clutter = "";
	womanR.forEach(function(obj){
		clutter +=` <div class="product-card" data-product-id="">
		<div class="product-card__container">
			<div class="product-card__btn cart" data-tooltip="add to cart"><span class="fa-solid  fa-shopping-bag"></span></div>
			<div class="product-card__btn fav" data-tooltip="add to wishlist"><span class="fa-regular fa-heart"></span></div>
			<div class="product-card__img">
				<img src="${obj.img}" alt="${obj.title}" />
			</div>
		</div>
		<div class="product-card__description">
			<div class="product-card__text">${obj.title}</div>
			<div class="product-card__price">${obj.prevPrice}</div>
		</div>
		</div>
	`
	})
	document.querySelector(".most-popular-products")
	.innerHTML = clutter;
  }showWomanCard();



